import React from "react";
import styled from 'styled-components';


const Body = (props) => {

    return (
        <Bodycard>
            console.log(props);
            <ImageContainer>
                <img src={props.Image} alt="" />
            </ImageContainer>
            <Content>
                <h3>Your onsestop non-pharma distributor</h3>
                <h2><span>Welcome to </span>Twokay chemicals</h2>
                <p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form.</p>         </Content>
            

        </Bodycard>
    )
}

const Bodycard = styled.div`
display: flex;
flex-direction: row;
margin: 150px 200px;



img {
    max-width:400px;
    height:auto;
  
}

    
`
const Content = styled.div`

span {
    padding-bottom: 10px;
    border-bottom-style: solid;
    border-bottom-width: 0.5px;
    width: fit-content;
    
}

color: #033B4A;

h3 {
   font-family: 'Allura', cursive;
   font-weight: 300;
   line-height: 40px;
   font-size: 40px;
   color: rgb(109, 109, 109);
  
}

h2 {
    font-family: 'Poppins', sans-serif;
    font-size: 35px;
    font-weight: 200;
    line-height: 35px;
    color: rgb(59, 94, 103);
}

P {
 
    font-family: 'Poppins', sans-serif;
   
    width: 50%;
    font-size:15px;
    font-weight: 400;
    line-height: 27px;

}
`
const ImageContainer = styled.div`
width: 50%;
`


export default Body;
